Actionscript.script:
_parent.无敌 = false;
if (_parent.受击招式 == "格挡")
{
	_parent.动画完毕();
}

onClipEvent (load) {
	_parent._parent.无敌 = true;

}
onClipEvent (unload) {
	_parent._parent.无敌 = false;
}

onClipEvent (enterFrame) {
	//_parent.攻击时移动(70,70);
	_parent.攻击时四向移动(拔刀上速度,拔刀下速度,拔刀左速度,拔刀右速度);
}
onClipEvent (load) {
	拔刀上速度 = 0;
	拔刀下速度 = 0;
	拔刀左速度 = 0;
	拔刀右速度 = 0;
	距离X = _parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x;
	距离Y = _parent._parent.Z轴坐标 - _root.gameworld[_parent._parent.攻击目标].Z轴坐标;
	if (距离Y > 0)
	{
		拔刀上速度 = (_parent._parent._y - _root.gameworld[_parent._parent.攻击目标].Z轴坐标) / 6;
	}
	else
	{
		拔刀下速度 = (_root.gameworld[_parent._parent.攻击目标].Z轴坐标 - _parent._parent._y) / 6;
	}
	if (距离X >= 0)
	{
		if (距离X <= 200)
		{
			_parent.攻击时四向移动(拔刀上速度 * 6,拔刀下速度 * 6,距离X-30,0);
			_parent.gotoAndPlay("原地连击");
		}
		else if (距离X <= 600)
		{
			拔刀左速度 = -10 + (_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) / 6;
		}
		else
		{
			拔刀左速度 = 100;
		}
	}
	else
	{
		if (距离X >= -200)
		{
			_parent.攻击时四向移动(拔刀上速度 * 6,拔刀下速度 * 6,0,-距离X-30);
			_parent.gotoAndPlay("原地连击");
		}
		else if (距离X >= -600)
		{
			拔刀右速度 = -10 + (_root.gameworld[_parent._parent.攻击目标]._x - _parent._parent._x) / 6;
		}
		else
		{
			拔刀右速度 = 100;
		}
	}
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1.5;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30.
	子弹属性.击倒率 = 5;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

