onClipEvent(load){
   _parent._parent.Z轴坐标 = _parent._parent._y = _root.gameworld[_parent._parent.攻击目标].Z轴坐标;
   _parent._parent.swapDepths(_parent._parent.Z轴坐标);
   if(_parent._parent.方向 == "右")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 160;
   }
   else if(_parent._parent.方向 == "左")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 160;
   }
   _parent.攻击时移动(移动距离,移动距离);
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 5;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

onClipEvent(enterFrame){
}
onClipEvent(load){
   _parent._parent.Z轴坐标 = _parent._parent._y = _root.gameworld[_parent._parent.攻击目标].Z轴坐标;
   _parent._parent.swapDepths(_parent._parent.Z轴坐标);
   if(_parent._parent.方向 == "右")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 160;
   }
   else if(_parent._parent.方向 == "左")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 160;
   }
   _parent.攻击时移动(移动距离,移动距离);
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
